import React from "react";

function Projects (){
return <div>
        <h2>
            proyectos
            {console.log("proyectps")}
        </h2>
</div>
}
export default Projects;

import { motion, AnimatePresence } from "framer-motion"

export const Pro = ({ image }) => (
  <AnimatePresence>
    <motion.img
      key={image.src}
      src={image.src}
      initial={{ opacity: 0, y: 200 }}
      animate={{ opacity: 1 }}
      exit={{ opacity: 0 }}
    />
  </AnimatePresence>
)
